.tariff {
  display: flex;
  flex: 1;
  flex-direction: column;
  margin-bottom: 40px;
  border: 2px solid var(--mantine-color-violet-7);
  border-radius: 20px;
  padding: 32px 20px;

  h5 {
    margin-bottom: 20px;
    font-size: 24px;
    line-height: 28px;
    text-align: center;
  }

